import * as api from '@/api/system/process/processConfiguration';
import { DICT_TYPE_OPTIONS } from '@/utils/constant';
export default {
  name: 'dict',
  components: {},
  data: function data() {
    return {
      id: null,
      src: null,
      iframeWin: null,
      dialogVisible: false,
      isSingle: false,
      //表格是否单选 点击各按钮根据流程逻辑控制单多选
      variableList: [],
      formList: {},
      activeCollNames: ['1'],
      activeCollNamesub: ['2'],
      enableds: {
        areaEnabled: false,
        locationEnabled: false,
        wmsEnabled: false
      },
      dictCode: undefined,
      selectCode: [],
      tableKey: [0, 1],
      //表格索引，虚拟dom渲染表格时使用
      dictTypeOptions: DICT_TYPE_OPTIONS,
      dictItems: [],
      activityQuery: {
        activityid: undefined,
        inflows: undefined,
        outflows: undefined,
        prodefId: undefined,
        type: undefined
      }
    };
  },
  mounted: function mounted() {},
  methods: {
    initForm: function initForm(row) {
      this.variableList = row.variableList;
      this.id = row.id;
      this.$set(this.formList, 'cancel', row.cancel === '0' ? false : true);
      this.$set(this.formList, 'cancelnode', row.cancelnode);
      this.$set(this.formList, 'modapper', row.modapper === '0' ? false : true);
      this.$set(this.formList, 'samepauto', row.samepauto === '0' ? false : true);
      this.$set(this.formList, 'samepnext', row.samepnext);
      this.$set(this.formList, 'servicename', row.servicename);
      this.$set(this.formList, 'starturl', row.starturl);
      this.$set(this.formList, 'webroot', row.webroot);
    },
    //前端表格保存
    handleSaveTable: function handleSaveTable(index, row) {
      console.log(row);
      this.variableList[index].isSave = false;
      this.variableList[index].isEdit = true;
    },
    //前端表格编辑
    // handleEditTable(index) {
    //     this.variableList[index].rowEdit = true
    // },
    //前端表格删除
    handleDeleteTable: function handleDeleteTable(index, row) {
      this.variableList = this.variableList.filter(function (item) {
        console.log(item.id, row.id);
        return item.id !== row.id;
      });
    },
    handleCreate: function handleCreate() {
      var newValue = {
        id: '',
        name: '',
        type: 'String',
        value: '',
        // isSave: true,
        // isEdit: false,
        editable: true //是否为不可修改数据

      };
      this.variableList.push(newValue);
    },
    handleSave: function handleSave() {
      var _this = this;

      if (this.id && this.formList.cancelnode) {
        this.formList.variableList = this.variableList;
        this.$set(this.formList, 'cancel', this.formList.cancel === true ? 1 : 0);
        this.$set(this.formList, 'modapper', this.formList.modapper === true ? 1 : 0);
        this.$set(this.formList, 'samepauto', this.formList.samepauto === true ? 1 : 0);
        api.infoConfig(this.id, this.formList).then(function (res) {
          console.log(res);
          _this.dialogVisible = false;

          _this.$emit('refresh');
        });
      } else {
        this.$message({
          type: 'warning',
          message: '选择有意义的流程节点'
        });
      }
    },
    // 撤回配置变化
    cancelChange: function cancelChange() {
      this.$set(this.formList, 'cancelnode', '');
      this.$set(this.formList, 'cancelnodeName', '');
    },
    //点击节点后触发
    nodeClick: function nodeClick(data) {
      if (data.params.data.type === 'userTask') {
        this.$set(this.formList, 'cancel', true);
        this.$set(this.formList, 'cancelnode', data.params.data.activityId);
        this.$set(this.formList, 'cancelnodeName', data.params.data.name);
      }
    }
  }
};
